import React, { useEffect } from "react";
import { fetchAccessHistory } from "../../services/doctorApi";
import { useDoctorStore } from "../../store/useDoctorStore";
import SidebarNav from "../../components/doctor/SidebarNav";

export default function AccessHistory() {
  const { doctor, accessHistory, setAccessHistory } = useDoctorStore();

  useEffect(() => {
    fetchAccessHistory(doctor.id).then(res => setAccessHistory(res.history));
  }, [doctor, setAccessHistory]);

  return (
    <div className="flex h-screen">
      <SidebarNav />
      <main className="flex-1 bg-gray-50 p-8 overflow-auto">
        <h2 className="text-2xl font-semibold mb-4">Access History</h2>
        <table className="w-full bg-white rounded-2xl shadow">
          <thead>
            <tr className="border-b">
              {["Time","Patient ID","Action","Location"].map(h => (
                <th key={h} className="p-3 text-left">{h}</th>
              ))}
            </tr>
          </thead>
          <tbody>
            {accessHistory.map((h,i) => (
              <tr key={i} className="border-b hover:bg-gray-50">
                <td className="p-3">{h.time}</td>
                <td className="p-3">{h.patientId}</td>
                <td className="p-3">{h.action}</td>
                <td className="p-3">{h.location}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </main>
    </div>
  );
}
